	add("camaraderie", "{\"term\":\"camaraderie\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"Latin\"], \"text\":\"{{borrowing|fr|lang\u003den}}, from Spanish {{m|es|camarada}}, from {{m|es|cámara||bedroom}}, from Latin {{m|la|camera||a chamber}}; see {{m|en|chamber}}. Literally “one with whom one shares one’s bedroom”. Compare {{m|en|comrade}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Close friendship in a group of friends or teammates\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A spirit of familiarity and closenes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1838\u0027\u0027, Caulincourt, \u0027Napoleon and his Times\u0027, [http://books.google.com/books?id\u003d-g4WAAAAYAAJ\u0026amp;printsec\u003dfrontcover\u0026amp;dq\u003dintitle:Napoleon+intitle:and+intitle:his+intitle:Times\u0026amp;lr\u003dlang_en\u0026amp;as_drrb_is\u003db\u0026amp;as_minm_is\u003d2\u0026amp;as_miny_is\u003d1500\u0026amp;as_maxm_is\u003d5\u0026amp;as_maxy_is\u003d1841\u0026amp;as_brr\u003d0\u0026amp;cd\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dcamaraderie\u0026amp;f\u003dfalse Volume 1, page 175\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"There was not one of Napoleon\u0027s intimate friends, however high in rank, who would have ventured to indulge in the sort of \u0027\u0027\u0027camaraderie\u0027\u0027\u0027 which was kept up between the Emperor and his old \u0027moustaches\u0027. \u0026lt;!--Italics in original--\u0026gt\", \"priority\":5}]}, \"synonyms\":{}}");

