	add("cameo", "{\"term\":\"cameo\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"From Italian \u0027cammeo\u0027 The movie sense is short for “cameo role” referring to a famous person who was playing no character, but him or herself. Like a cameo brooch — a low-relief carving of a person’s head or bust — the actor or celebrity is instantly recognizable. More recently, it has come to refer to any short appearances, whether as a character or as oneself.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A piece of jewelry, etc., carved in relief\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A single very brief appearance, especially by a prominent celebrity in a movie or song\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1519647W “Piracy”: A Romantic Chronicle of These chapter\u003dEp./4/2|passage\u003dAs they turned into Hertford Street they startled a robin from the poet\u0027s head on a barren fountain, and he fled away with a \u0027\u0027cameo\u0027\u0027 note\", \"priority\":3}]}, \"synonyms\":{}}");

