	add("camiknickers", "{\"term\":\"camiknickers\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"The term was coined in the 1920s when camiknickers were introduced as a briefer garment than combinations. It is derived from \u0027camisole\u0027 and \u0027knickers\u0027, effectively joining those two garments together as one. The garment re-appeared in the lingerie market in the 1990s under the name \u0027\u0027teddy\u0027\u0027 or \u0027\u0027body\u0027\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A women\u0027s undergarment covering the torso, worn for example under short dresses or slacks\", \"priority\":1}]}, \"synonyms\":{}}");

