	add("campaign", "{\"term\":\"campaign\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Italian\", \"Latin\"], \"text\":\"From French \u0027campagne\u0027 from Italian \u0027campagna\u0027 (field, military operation) from {{m|la|campānia||open country, battlefield}}, from Latin \u0027campus\u0027 (field)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A series of operations undertaken to achieve a set goal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"an election \u0027\u0027campaign\u0027\u0027; a military \u0027\u0027campaign\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The company is targeting children in their latest advertising \u0027\u0027campaign\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An open field; a large, open plain without considerable hills; a champaign\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The period during which a blast furnace is continuously in operation\", \"priority\":5}]}, \"synonyms\":{}}");

	add("campaignspeak", "{\"term\":\"campaignspeak\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|campaign|speak|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The jargon used by politicians, lobbyists, and commentators, especially during a political campaign\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Doris Mortman, \u0027The Lucky Ones\u0027, Zebra Books (1998), ISBN 9780821759202, [https://books.google.com/books?id\u003dwYeK2scIv2wC\u0026amp;q\u003d%22campaignspeak%22 page 50\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;That\u0027s why I need you so badly, Zoë. You know how to translate the harsh realities of foreign policy into relatively intelligible \u0027\u0027campaignspeak\u0027\u0027.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Zoë laughed. \u0026quot;Intelligible \u0027\u0027campaignspeak\u0027\u0027 is an oxymoron.\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, William Blum, \u0027Rogue State: A Guide to the World\u0027s Only Superpower\u0027, Common Courage Press (2000), ISBN 9781567511949, [https://books.google.ca/books?id\u003d7d1P-tJU5tYC\u0026amp;q\u003d%22campaignspeak%22 page 11\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The media and the public do in fact relish catching politicians\u0027 lies, but these are the small lies — lies about money, sex, drug use and other peccadillos, and the ritual doubletalk of \u0027\u0027campaignspeak\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Chris Lehmann, \u0026quot;[http://www.washingtonpost.com/wp-dyn/content/article/2007/07/12/AR2007071201978.html Psyched]\u0026quot;, \u0027The Washington Post\u0027, 15 July 2007\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Unfortunately, \u0027The Political Brain\u0027 doesn\u0027t follow up on the implications of this research. Rather, Westen, who describes himself as ardently \u0026quot;pro-Democratic,\u0026quot; transposes his clinical findings into one-sided \u0027\u0027campaignspeak\", \"priority\":8}]}, \"synonyms\":{}}");

