	add("camphor", "{\"term\":\"camphor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Malay\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|camphore}} or {{m|la|camphora}}, ultimately of origin; compare Malay \u0027kapur\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A white transparent waxy crystalline isoprenoid ketone, with a strong pungent odour, used in pharmacy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1895\u0027\u0027, H. G. Wells, \u0027The Time Machine\u0027 Chapter\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I fancied at first the stuff was paraffin wax, and smashed the jar accordingly. But the odour of \u0027\u0027camphor\u0027\u0027 was unmistakable. It struck me as singularly odd, that among the universal decay, this volatile substance had chanced to survive, perhaps through many thousand years\", \"priority\":3}]}, \"synonyms\":{}}");

